from functools import wraps

def memoize(func):
    cache = dict()

    @wraps(func)
    def memoized_func(*args):
        if args in cache:
            return cache[args]
        result = func(*args)
        cache[args] = result
        return result

    return memoized_func

@memoize
def calculate_interest(principal, rate, time):
    # Perform interest calculation
    return principal * rate * time

@memoize
def calculate_compound_interest(principal, rate, time, periods):
    # Perform compound interest calculation
    return principal * (1 + rate / periods) ** (periods * time)

