    cache = {}
    def decorator(func):
        @wraps(func)
        def wrapper(*args):
            now = time.time()
            if args in cache:
                result, timestamp = cache[args]
                if now - timestamp < ttl:
                    print(f"Retrieving cached result for {args}")
                    return result
                else:
                    print(f"Cache expired for {args}. Retrieving from API...")
                    del cache[args]
            else:
                print(f"No cached result found for {args}. Retrieving from API...")
