        self.weights = [random.random() for _ in range(1000000)]

class ModelPool:
    def __init__(self, size):
        self.size = size
        self.pool = Queue(maxsize=size)
        for _ in range(size):
            self.pool.put(Model())

    def acquire(self):
        if not self.pool.empty():
            return self.pool.get()
        else:
            return Model()

    def release(self, model):
        if not self.pool.full():
            model.reset()
            self.pool.put(model)

