def generate_permutations(inputs):
    def backtrack(start, end):
        if start == end:
            yield inputs[:]
        for i in range(start, end):
            inputs[start], inputs[i] = inputs[i], inputs[start]
            yield from backtrack(start + 1, end)
            inputs[start], inputs[i] = inputs[i], inputs[start]

    return list(backtrack(0, len(inputs)))

