class Stack:
    def __init__(self):
        self.items = []

    def push(self, item):
        self.items.append(item)

    def pop(self):
        return self.items.pop()

    def is_empty(self):
        return len(self.items) == 0

    def size(self):
        return len(self.items)

    def resize(self, new_size):
        if new_size < 0:
            raise ValueError("New size must be a non-negative integer.")
        if new_size < len(self.items):
            self.items = self.items[:new_size]
        self.items = self.items + [None] * (new_size - len(self.items))

stack = Stack()
for i in range(10):
    stack.push(i)
stack.resize(5)
while not stack.is_empty():
    print(stack.pop())
