import requests

def load_data(url):
    try:
        response = requests.get(url)
        response.raise_for_status()
        return response.text
    except requests.exceptions.HTTPError as e:
        raise Exception(f"Error loading data from {url}. Status code: {e.response.status_code}")
    except requests.exceptions.RequestException as e:
        raise Exception(f"Error loading data from {url}. Details: {e}")

url_list = ["https://www.example.com", "https://www.example.com/missing_page"]

for url in url_list:
    try:
        data = load_data(url)
        print(data)
    except Exception as e:
        print(e)
